.
.
.
El día de ayer Variety confirmó que Sony se encuentra produciendo una serie live - action sobre Silk, personaje de los cómics de Marvel que, entendemos formará parte del universo que actualmente está haciendo Sony sobre Spiderman, con películas como Morbius y Venom.😱
.
.
.
Pero a todo esto, ¿quién es Silk? Silk es un personaje introducido en los cómics de Marvel en 2014 y su nombre real es Cindy Moon, una chica coreana-americana que comparte clase con Peter Parker y también fue mordida por una araña radiactiva, esta le otorga a Moon poderes como la supervelocidad, el lanzamiento de telarañas y un sentido arácnido mucho mayor que el de Peter.😳💪🏼
.
.
.
Anteriormente Sony había anunciado que este personaje protagonizaría una de sus películas, pero al igual que con Black Cat y Silver Sable, estos proyectos se quedarían parados de forma indefinida.😔
.
.
.
Silk sería un personaje interesante para llevarlo a la vida, sobre todo en estos momentos en  donde se vive una etapa de inclusión. Sony.serie live - action será producida por Phil Lord y Chris Miller, quienes trabajaron en el desarrollo de ‘Spiderman Into the Spiderverse’ (2018), también contaría con  la participación de Amy Pascal, reconocida productora de Sony.😍
.
.
.
Aún se desconoce la plataforma por la cual se emitirá esta serie, aunque los rumores indican que Amazon estaría interesada. Tampoco se ha declarada la fecha de estreno de la misma.🤯
